import quick_sort from "@code/QuickSort";

test("quick-sort", function () {
    const arr = [9, 3, 7, 4, 69, 420, 42];

    debugger;
    quick_sort(arr);
    expect(arr).toEqual([3, 4, 7, 9, 42, 69, 420]);
});
test("quick-sort - LC/TC: 912 / 1", function () {
    const arr = [5,2,3,1]
    const expected = [1,2,3,5]
    quick_sort(arr);
    expect(arr).toEqual(expected);
});

test("quick-sort - LC/TC: 912 / 2", function () {
    const arr = [5,1,1,2,0,0]
    const expected = [0,0,1,1,2,5]
    quick_sort(arr);
    expect(arr).toEqual(expected);
});

test("quick-sort - LC/TC: 912 / 3", function () {
    const arr = [50000, 49999, 49998, 49997, 49996, 49995, 49994, 49993, 49992, 49991]
    const expected = [49991,49992,49993,49994,49995,49996,49997,49998,49999,50000]
    quick_sort(arr);
    expect(arr).toEqual(expected);
});

